"use strict";chrysalisApp.controller("TitleController",["$scope","$http","$location",function(n,t,e){t.get("data/navItems.json").success(function(t){n.navItems=t,n.url=e.$$url,n.fixLink=function(){"/"===n.url?n.link="/":n.link=n.url.replace("/","")},n.fixLink();for(var l=0;l<n.navItems.length;l++)n.navItems[l].link===n.link&&(n.currentTitle=n.navItems[l].name,n.imageTitle=n.navItems[l].titleImage)})}]);